      | 356837 -> { ItemTypeData.id= 356837; name= "'Dren' Assault Rifle"; published= false; description= "Conceived by Duvolle Laboratories, a corporation best known for its ceaseless R&D, the G75-VLB solves many of the problems inherent in mass-manufactured plasma weapons. The result is a weapon that offers improved accuracy and greater containment field stability (which equates to faster, longer bursts of fire) than anything in its class.   It is a magazine-fed, short-to-mid range weapon offering fully automatic fire. Charged plasma munitions are pumped into a cyclotron that converts the plasma into a highly lethal bolt before it is expelled from the chamber. Upon impact with the target, the magnetic field surrounding the bolt collapses, venting superheated plasma onto the contact point."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
