      | 364791 -> { ItemTypeData.id= 364791; name= "'Skinjuice' Boundless Remote Explosive"; published= false; description= "The F/41 series of remote explosives are among the most powerful manually triggered demolitions devices available in New Eden. Each unit is reliable and effective, using a mix of three volatile materials to produce a yield high enough to penetrate layered armor, shatter reinforced structures, and decimate infantry units.  These explosives are deployed by hand and detonated using a coded frequency generated by the Cortex Holographic Interface, which maintains a database of unique activation ciphers for every charge placed. The F/41 product line also boasts several other advanced features, such as EM hardened circuits, an encrypted multi-frequency receiver, and a lightweight hybrid ceramic frame."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365567 -> { ItemTypeData.id= 365567; name= "Kaalakiota Magsec SMG"; published= false; description= "The magsec is a semi-automatic firearm capable of sustained, accurate fire at ranges beyond what conventional sidearms can offer. A high-speed slider feeds current to a magazine of hyper velocity projectiles that are discharged with minimal separation, maximizing energy efficiency and reducing flux shear to produce a weapon with lethal kinetic potential.     Having overcome early reliability issues, manufacturers  have since taken advantage of the weapon’s modular design; the magsec has been made available in multiple combat configurations – including optical sights and silenced operation – and is in widespread service throughout the cluster."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
